import React,{useState} from "react";
import {useNavigate} from "react-router-dom";



function PersonalPage(){
    const [passengerName,setpassengerName]= useState();
    const [age,setage]= useState();
    const [email,setemail]= useState();
    const navigate=useNavigate();


    const personalPageSubmit = event => {
        event.preventDefault(); 

        console.log('personalPageSubmit done');
        navigate("confirmationpage");

    };

    return(
      <><div className='Place'>
        <h2>
          Destination Details
        </h2>
        <select className="PlaceNames">
          <option value="1">Bus no: ka09123 time: 12pm</option>
          <option value="2">Bus no: ka0567 time: 1pm</option>
          <option value="3">Bus no: ka34567 time: 2pm</option>
          <option value="4">Bus no: ka091789 time: 8am</option>

        </select>
      </div><form className='SubmitPlaces' onSubmit={personalPageSubmit}>
          <p className='PlaceLst'>
            <div>
            <b>Enter passenger Name</b>
            <input
              id="passengerName"
              name="passengerName"
              type="text"
              onChange={event => passengerName(event.target.value)}
              value={passengerName} />
            </div>
            <div>
            <b>Enter age of passenger   </b>
            <input
              id="age"
              name="age"
              type="text"
              onChange={event => age(event.target.value)}
              value={age} />
             <b>Enter your E-mail id</b>
             </div>
            <input
              id="email"
              name="email"
              type="text"
              onChange={event => email(event.target.value)}
              value={email} />

          </p>
          <button type='submit'> Submit</button>
        </form></>
    )

}
export default PersonalPage;
